using AElf;
using AElf.Scripts;
using AElf.Scripts.Predefined;
using AnonymousVoteAdmin;
using Google.Protobuf.WellKnownTypes;
using Microsoft.Extensions.Logging;

namespace TomorrowDAO.Pipelines.AnonymousVoteDeployment;

public class AnonymousVoteDeploymentScript : ScriptWithConfig<Config>
{
    public AnonymousVoteDeploymentScript()
    {
        DeployMerkleTree = new(Config.MerkleTreeContractCodePath);
    }

    public DeployContractScript DeployMerkleTree;


    public DeployContractScript DeployZkVerifier = new(
        Convert.FromBase64String(B64VerifierCode)
    );

    internal AnonymousVoteAdminContractContainer.AnonymousVoteAdminContractStub AnonymousVoteAdminContractStub
    {
        get;
        private set;
    }

    public override async Task RunAsync()
    {
        InitializeStub();
        await MaybeDoDeployAsync("tmrdao.merkletree", DeployMerkleTree);
        await MaybeDoDeployAsync("tmrdao.zkverifier", DeployZkVerifier);

        Logger.LogTrace("Setting merkle tree history contract address");
        await AnonymousVoteAdminContractStub.SetMerkleTreeHistoryContractAddress.SendAsync(
            DeployMerkleTree.DeployedAddress);

        Logger.LogTrace("Set merkle tree history contract address");
        Logger.LogTrace("Setting zk verifier address");
        await AnonymousVoteAdminContractStub.SetGroth16VerifierAddress.SendAsync(
            DeployZkVerifier.DeployedAddress);
        Logger.LogTrace("Set zk verifier address");


        var groth16Address = await AnonymousVoteAdminContractStub.GetGroth16VerifierAddress.CallAsync(new Empty());
        var merkleTreeAddress = await
            AnonymousVoteAdminContractStub.GetMerkleTreeHistoryContractAddress.CallAsync(new Empty());
        Logger.LogInformation("Merkle tree address: {MerkleTreeAddress}", merkleTreeAddress);
        Logger.LogInformation("Zk verifier address: {ZkVerifierAddress}", groth16Address);
    }

    private void InitializeStub()
    {
        AnonymousVoteAdminContractStub =
            this.GetInstance<AnonymousVoteAdminContractContainer.AnonymousVoteAdminContractStub>(
                Config.VoteContractAddress);
    }

    private const string B64VerifierCode =
        "";

    private async Task MaybeDoDeployAsync(string id, DeployContractScript script)
    {
        NextSalt = HashHelper.ComputeFrom(id);
        script.SkipIfAlreadyDeployed = true;
        await script.RunAsync();
    }
}